import "./index.css";
import { createRoot } from "react-dom/client";
import { BrowserRouter } from "react-router-dom";
import App from "./App";


const divDoIndex = document.getElementById("root");
const root = createRoot(divDoIndex);

root.render(
    <BrowserRouter><App /></BrowserRouter>
);
